import project_photo from "../images/project-photo.png";

export function Projects() {
  return (
    <section className="projets">
      <div className="project-title">
        <h5>Projects</h5>
      </div>
      <img />
      <div className="details">
        <img
          src={project_photo}
          className="project-photo"
          width="100%"
          height="auto"
        />
        <p>
          Frontend development in React of a social media platform like website
          allowing users to find, post and share recipes.
        </p>
      </div>
    </section>
  );
}
